import React from 'react';
import './PlanetCard.css';

const PlanetCard = ({name, climate, gravity, terrain}) => {
    return(
        <div className="Card">
            <img src='https://unsplash.com/photos/uIf6H1or1nE' width="50" height="50"></img>
            <p>name: {name} </p>
        </div>
    );
}

export default PlanetCard;
